const desks = {
    state: {
      desks: [
        {id:1, isaken:false, place:"bigRoom"},
        {id:2, isaken:false, place:"bigRoom"},
        {id:3, isaken:false, place:"bigRoom"},
        {id:4, isaken:true, place:"bigRoom"},
        {id:5, isaken:true, place:"bigRoom"},
        {id:6, isaken:true, place:"bigRoom"},
        {id:7, isaken:true, place:"smallRoom"},
        {id:8, isaken:true, place:"smallRoom"},
        {id:9, isaken:true, place:"smallRoom"},
        {id:10, isaken:true, place:"smallRoom"},
      ],
    },
    mutations: {},
    actions: {},
    getters: {},
  };
  
  export default desks;
